    <div className='homepage'>
        <Profiler id="Directory" onRender={(id, phase, actualDuration) => {
            console.log({
                id,
                phase,
                actualDuration,
            });
        }}>
            <Directory />
        </Profiler>
    </div>
);

export default HomePage;
